n.wikipedia.org/wiki/Juno_%28spacecraft%29)[1](https://en.wikipedia.org/wiki/Juno_%28spacecraft%29). Juno’s mission is to measure Jupiter’s composition, gravitational field, magnetic field, and polar magnetosphere. [It will also search for clues about how the planet formed, including whether it has a rocky core, the amount of water present within the deep atmosphere, mass distribution, and its deep winds](https://en.wikipedia.org/wiki/Juno_%28spacecraft%29)[1](https://en.wikipedia.org/wiki/Juno_%28spacecraft%29). [Juno is the second spacecraft to orbit Jupiter, after the Galileo orbiter, which orbited from 1995 to 2003](https://en.wikipedia.org/wiki/Juno_%28spacecraft%29)[1](https://en.wikipedia.org/wiki/Juno_%28spacecraft%29). [Unlike all earlier spacecraft sent to the outer planets, Juno is powered by solar panels](https://en.wikipedia.org/wiki/Juno_%28spacecraft%29)[1](https://en.wikipedia.org/wiki/Juno_%28spacecraft%29).logseq____&quot;,536870989]],[logseq____&quot;^15logseq____&quot;,[1753,logseq____&quot;^Ologseq____&quot;,logseq____&quot;^16logseq____&quot;,536870989]],[logseq____&quot;^15logseq____&quot;,[1753,logseq____&quot;^Flogseq____&quot;,161,536870989]],[logseq____&quot;^15logseq____&quot;,[1753,logseq____&quot;^Xlogseq____&quot;,161,536870989]],[logseq____&quot;^15logseq____&quot;,[1753,logseq____&quot;^Vlogseq____&quot;,161,536870989]],[logseq____&quot;^15logseq____&quot;,[1753,logseq____&quot;^Ulogseq____&quot;,161,536870989]],[logseq____&quot;^15logseq____&quot;,[1753,logseq____&quot;^;logseq____&quot;,logseq____&quot;~u65a41754-65b8-49cc-bc82-29cf8e158e7dlogseq____&quot;,536870989]],[logseq____&quot;^15logseq____&quot;,[1755,logseq____&quot;^Klogseq____&quot;,1705252692818,536870990]],[logseq____&quot;^15logseq____&quot;,[1755,logseq____&quot;^@logseq____&quot;,false,536870990]],[logseq____&quot;^15logseq____&quot;,[1755,logseq____&quot;^Ylogseq____&quot;,logseq____&quot;list of rocketry teamslogseq____&quot;,536870990]],[logseq____&quot;^15logse       // This script checks to see if a redirect is present in the query string
      // and converts it back into the correct url and adds it to the
      // browser's history using window.history.replaceState(...),
      // which won't cause the browser to attempt to load the new url.
      // When the single page app is loaded further down in this file,
      // the correct url will be waiting in the browser's history for
      // the single page app to route accordingly.
      (function(l) {
        if (l.search) {
          var q = {};
          l.search.slice(1).split('&').forEach(function(v) {
            var a = v.split('=');
            q[a[0]] = a.slice(1).join('=').replace(/~and~/g, '&');
          });
          if (q.p !== undefined) {
            window.history.replaceState(null, null,
              l.pathname.slice(0, -1) + (q.p || '') +
              (q.q ? ('?' + q.q) : '') +
              l.hash
            );
          }
        }
      }(window.location))</script>
